import React, { useState } from "react";
import { Avatar, Divider,Modal } from "@mui/material";
import Popover from '@mui/material/Popover';
import { useNavigate } from 'react-router-dom';
import { useLocation } from "react-router-dom";
import GoogleMapReact from 'google-map-react';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';
import UserDetails from './userDetails'
import ClickAwayListener from '@mui/base/ClickAwayListener';
const ProfilePage = () => {
    const [tab, settab] = useState(1)
    const [open, setOpen] = useState(false)
    const location = useLocation();

    const openPop = () => {
        if (open == true) {
            setOpen(false)
        } else {
            setOpen(true)
        }
    }

    console.log(location.state.user, 'history');
    let userData = location?.state?.user;

    const tabChange = (value) => {
        settab(value)
    }

    return (
        <div className="col-md-12" style={{ display: 'flex', height: '100vh' }} >
            <div className="col-md-3 d-flex justify-content-center">
                <div className="menu-item">
                    <div className="tabs d-flex align-items-center" style={{ flexDirection: 'column' }}>
                        <div className="col-md-12 py-4 ps-4 d-flex">
                            <div className="col-md-10" onClick={() => tabChange(1)} style={{ cursor: 'pointer' }} >
                                <div style={{ fontSize: '20px', textAlign: 'left', color: '#A6A5E4' }} className="">Profile</div>
                                <Divider style={{ color: '#A6A5E4', height: '2px' }} />
                            </div>
                            {tab == 1 ?
                                <div className="col-md-2 d-flex justify-content-end">
                                    <div style={{ background: 'white', borderRadius: '100px 0 0 100px', width: '40px' }} >
                                        <div style={{ color: '#BEC5D4' }}><ChevronRightIcon /></div>
                                    </div>
                                </div> : ''}
                        </div>
                        <div className="col-md-12 py-4 ps-4 d-flex">
                            <div className="col-md-10" onClick={() => tabChange(2)} style={{ cursor: 'pointer' }}>
                                <div style={{ fontSize: '20px', textAlign: 'left', color: '#A6A5E4' }} className="">Posts</div>
                                <Divider style={{ color: '#A6A5E4', height: '2px' }} />
                            </div>
                            {tab == 2 ?
                                <div className="col-md-2 d-flex justify-content-end">
                                    <div style={{ background: 'white', borderRadius: '100px 0 0 100px', width: '40px' }} >
                                        <div style={{ color: '#BEC5D4' }}><ChevronRightIcon /></div>
                                    </div>
                                </div> : ''}
                        </div>

                        <div className="col-md-12 py-4 ps-4 d-flex">
                            <div className="col-md-10" onClick={() => tabChange(3)} style={{ cursor: 'pointer' }} >
                                <div style={{ fontSize: '20px', textAlign: 'left', color: '#A6A5E4' }} className="">Gallery</div>
                                <Divider style={{ color: '#A6A5E4', height: '2px' }} />
                            </div>
                            {tab == 3 ?
                                <div className="col-md-2 d-flex justify-content-end">
                                    <div style={{ background: 'white', borderRadius: '100px 0 0 100px', width: '40px' }} >
                                        <div style={{ color: '#BEC5D4' }}><ChevronRightIcon /></div>
                                    </div>
                                </div> : ''}
                        </div>
                        <div className="col-md-12 py-4 ps-4 d-flex">
                            <div className="col-md-10" onClick={() => tabChange(4)} style={{ cursor: 'pointer' }}>
                                <div style={{ fontSize: '20px', textAlign: 'left', color: '#A6A5E4' }} className="">ToDo</div>
                            </div>
                            {tab == 4 ?
                                <div className="col-md-2 d-flex justify-content-end">
                                    <div style={{ background: 'white', borderRadius: '100px 0 0 100px', width: '40px' }} >
                                        <div style={{ color: '#BEC5D4' }}><ChevronRightIcon /></div>
                                    </div>
                                </div> : ''}
                        </div>
                    </div>
                </div>
            </div>
            <div className="col-md-9 p-4">
                    <div className="col-md-12 d-flex" onClick={openPop} style={{ cursor: 'pointer' }}>
                        <div className="col-md-6 d-flex align-align-items-center justify-content-lg-start"
                            style={{ color: '#545454', fontSize: '23px', fontWeight: '500' }} >Profile</div>
                        <div style={{ display: 'flex', alignItems: 'center' }} className="col-md-6 justify-content-end" >
                            <Avatar src={userData?.profilepicture} />
                            <p style={{ color: '#545454', fontSize: '23px', fontWeight: '400', margin: '10px' }} >{userData?.name}</p>
                        </div>
                    </div>
                    <Modal open={open}  onClose={openPop} style={{height: '300px'}}>
                        <div style={{background: 'white' ,border: 'none'}} className="w-25" >  Hello</div>
                    </Modal>

                <Divider />

                {tab == 1 ? <UserDetails userData={userData} /> :
                    <div>
                        <div style={{ fontSize: '100px', fontWeight: "bolder", marginTop: '25vh', color: '#EEEEEE' }} >Coming Soon</div>
                    </div>
                }
            </div>
        </div>
    )
}
export default ProfilePage;
